import { isEnumDeclaration } from "typescript";

export enum ORIENTATION {
  NORD = "N",
  SUD = "S",
  EST = "E",
  OUEST = "O",
}

export enum MOOVE {
  GAUCHE = "G",
  DROITE = "D",
  AVANCE = "A",
}
